webpackJsonp([72092463367806],{1236:function(e,A){e.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/on-air-london-review/index.md absPath of file >>> MarkdownRemark",html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/onairreview-befd8aacdf30cc483feeb205cef838a9-e8574.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="onairreview.jpg"\n        title=""\n        src="/static/onairreview-befd8aacdf30cc483feeb205cef838a9-e8574.jpg"\n        srcset="/static/onairreview-befd8aacdf30cc483feeb205cef838a9-c94d9.jpg 158w,\n/static/onairreview-befd8aacdf30cc483feeb205cef838a9-9885b.jpg 315w,\n/static/onairreview-befd8aacdf30cc483feeb205cef838a9-e8574.jpg 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Well, despite coming down with a killer headache 1/2 way through the event, I thoroughly enjoyed the London leg of the on AIR tour. All the guys from Adobe and [most of] the \'guest speakers\' were really interesting. Toying around with AIR before the event helped understand things a little better, but looking up stuff on the \'net just doesn\'t compare to having it demonstrated on the tour. Like the <a href="http://www.webkitchen.be/2008/03/07/play-video-in-your-dock-with-air/" title="Open link in a new window">worlds smallest video player</a>.</p>\n<p>I think you can tell something\'s good if the event-hype subsides and you still find yourself dreaming up ideas.</p>\n<p>I believe that the whole day was being recorded - there was certainly some notices up about it, and a DV-Cam setup at the back. Doesn\'t appear to be online yet, though if I spot it, i\'ll let you know. In the meantime, here\'s a flickr image that I found with the MMT Digital lot in...</p>\n<p><img src="http://www.psyked.co.uk/wp-content/uploads/2008/04/2404158741_411bca6e29.jpg"></p>\n<p>You can find some more at the <a href="http://www.flickr.com/photos/tags/onair2008london/" title="Open link in a new window">flickr onair2008london group.</a></p>\n<h2>If you\'re interested in AIR, you might also want to check out...</h2>\n<ul>\n<li>Mike Chambers\' post on <a href="http://www.mikechambers.com/blog/2008/04/07/redistributing-the-adobe-air-runtime-installer/" title="Open link in a new window">Redistributing the AIR Runtime Installer</a>, because AIR isn\'t a replacement for Director or Zinc, it\'s coming at a whole new angle - more like Microsofts\' .Net Framework.</li>\n<li>And hey, this wasn\'t anything to do with the tour, but I noticed it yesterday - a Webcam to Flv encoder, built on Adobe AIR, from zero point nine : <a href="http://www.zeropointnine.com/blog/webcam-digital-video-recorder-for-air-updated" title="Open link in a new window">Webcam Digital Video Recorder for AIR.</a></li>\n</ul>',frontmatter:{title:"on AIR London / Review",date:"April 11, 2008",tags:["adobe","mdm-zinc","work"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/utf-8-bot-file-encoding-conversion-with-air/",tags:["flash","adobe","air","cs3"],title:"UTF-8 Bot - file encoding conversion with AIR",date:"2008-04-08T00:23:09.000Z"}},next:{frontmatter:{path:"/blog/air-files-downloading-as-zips/",tags:["troubleshooting"],title:"AIR files downloading as .zips?",date:"2008-04-11T21:19:05.000Z"}}}}}});
